import React from "react";
import "../../App.css";
import Header from "../../Components/Header/Header";
import DoctorIntro from "../../Components/DoctorIntro/DoctorIntro";
import DoctorBlock from "../../Components/DoctorBlock/DoctorBlock";

const DoctorPage = () => {
  return (
    <div className="App">
      <Header portal="Doctor Portal" pageType="doctor"></Header>
      <DoctorIntro></DoctorIntro>
      <DoctorBlock></DoctorBlock>
      {/* <button>Log in as Patient</button>
        <button>Log in as Docotr</button> */}
    </div>
  );
};

export default DoctorPage;
